import logo from './logo.svg';
import './App.css';
import Game from './Game';

function App() {
	return (
		<div className="App">
			<h1>Way Of Life</h1>
			<Game />
			<p>Click the board to add or remove a cell. </p>
			<p>
				Click "Next" to get the next iteration and click "Prev" to go back. You can go back up to 10 steps. Finally,
				click "Reset" to simply clear the board and start over.
			</p>
		</div>
	);
}

export default App;
